export const DEFAULE_COLOR = "#a0302d";

export const MODE = {
  PENCIL: "pencil",
  LINE: "line"
};

export const COLOR_MAP = {
  ORANGE: "#ef6101",
  YELLOW: "#fdac07",
  GREEN: "#47802b",
  BLUE: "#045658",
  DARK: "#03161d"
};

export const colors = Object.keys(COLOR_MAP);
